import { Table, Tag, Space ,Col} from 'antd';
import React from "react";
import {getFetch} from "../function/fetch";

const { Column, ColumnGroup } = Table;

const data = [
    {
        key: '1',
        firstName: 'John',
        lastName: 'Brown',
        age: 32,
        address: 'New York No. 1 Lake Park',
        tags: ['nice', 'developer'],
    },
    {
        key: '2',
        firstName: 'Jim',
        lastName: 'Green',
        age: 42,
        address: 'London No. 1 Lake Park',
        tags: ['loser'],
    },
    {
        key: '3',
        firstName: 'Joe',
        lastName: 'Black',
        age: 32,
        address: 'Sidney No. 1 Lake Park',
        tags: ['cool', 'teacher'],
    },
];

export default class TicketInfoPage extends React.Component {
    constructor() {
        super();
    }

    componentDidMount() {
        getFetch("/ticket/all",(rsp)=>this.setState(rsp))
    }

    render() {
        return(
            <Col span={12} offset={6}>
            <Table dataSource={data}>
                <Column title="ticket name" dataIndex="ticket name" key="tname" />
                <Column title="price" dataIndex="price" key="price" />
                <Column title="available nums" dataIndex="available nums" key="availableNum" />
                <Column
                    title=""
                    key="action"
                    render={(record) => (
                            <a onClick={()=>this.props.history.push("/ticket/details/"+record.tid)}>详情</a>
                    )}
                />
            </Table>
            </Col>
        );
    }
}
